import React, { Component } from 'react';


class Formulario extends Component {



    constructor() {
        super();
        this.data = "";
        this.hora = "";
        this.minuto = "";
    }

    handleMudancaMins(evento) {
        this.minuto = evento.target.value;
        console.log(this.minuto);
    }

    handleMudancaHora(evento) {
        this.hora = evento.target.value;
        console.log(this.hora);
    }

    handleMudancaData(evento) {
        this.data = evento.target.value;
        console.log(this.data);
    }

    submitFormulario(event) {
        event.preventDefault();
        console.log("Submitou");
    }

    render() {
        return (
            <form onSubmit={this.submitFormulario.bind(this)}>
                <input type="date" placeholder="data" onChange={ this.handleMudancaData.bind(this) } />
                <input type="text" placeholder="hora" onChange={ this.handleMudancaHora.bind(this) }/>
                <input type="text" placeholder="mins" onChange={ this.handleMudancaMins.bind(this) }/>
                <button>Criar</button>
            </form>
        );
    }
}

export default Formulario;
